import React from "react";

const Recepe=(props)=>{
   const {fet}=props;
    return(
        <>
        <h1>jjjjjj</h1>
        <div className="row">
         {
             fet.map(respe=>{
                 <>
               
                 <div className="col-md-3">
                      
                   <div className="card">
                       <div className="card-body">
                       <h1>{respe.recipe.label}</h1>
                       <h1>kkkkk</h1>
                      
                       </div>
                   </div>
                 </div>
                 </>
             })
         }



        </div>


        </>
    );
}
export default Recepe;
